import React, { useContext, useEffect, useState } from 'react';
import axios from "axios";
import { UserContext } from '../../App';
const Profile=()=>{
  const {state,dispatch}=useContext(UserContext);
  //create state to hold the users post 
  const[mypics,setPics]=useState([]);

  //Fetch the users post from backend api endpoint->mypost
  useEffect(()=>{
    //use axios with http GET request to fetch user post who is logged in 
    axios.get("http://localhost:5000/mypost",{
      headers:{
        "Content-Type":"application/json",
        "Authorization":"Bearer "+ localStorage.getItem("jwt")//attach token from localstorage
      }
    }).then(response=>{
      console.log(response.data);//log the data in console
      setPics(response.data.mypost)
    })
    .catch(error=>{
      console.log(error);
   })
  },[]);



      return(
        <div className="card input-filed postcontainer">
         <h5>French Fries - $40 </h5>
         <h5>Burger - $10 </h5>
         <h5>Pasta - $100 </h5>
         <h5>Pizza - $50 </h5>

         <input
         type="text"
         placeholder="Please specify any allergy"
         value={body}
         onChange={(e)=>setBody(e.target.value)}
         />
     <div className="file-field input-field">
       <div className="btn #3d5afe indigo accent-3">
         <span>Cancel Order/Edit Order</span>

       </div>
       <br></br>

       <div className="btn #3d5afe indigo accent-3">
         <span>Final Payment </span>

       </div>

       <div className="file-path-wrapper">
         <input className="file-path validate" type="text"/>
       </div>
     </div>



  </div>
    )
}

export default Profile;
